import React, { useState } from "react";

export default function Upload({ onNext }) {
  const [docType, setDocType] = useState("");
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(false);

  const handleFiles = (e) => {
    setFiles([...files, ...Array.from(e.target.files)]);
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setFiles([...files, ...Array.from(e.dataTransfer.files)]);
  };

  const removeFile = (index) => {
    setFiles(files.filter((_, i) => i !== index));
  };

  const uploadToBackend = async () => {
    if (!docType || files.length === 0) return;

    const formData = new FormData();

    files.forEach((file) => {
      formData.append("documents", file); // MUST match backend
    });

    formData.append("documentType", docType);

    try {
      setLoading(true);

      const res = await fetch("http://localhost:8000/api/upload-documents", {
        method: "POST",
        body: formData
      });

      if (!res.ok) {
        throw new Error("Upload failed");
      }

      const data = await res.json();
      onNext(data); // move to next step WITH backend response
    } catch (err) {
      console.error(err);
      alert("Failed to upload documents");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container">
      <h2>üìÑ Upload Identity Documents</h2>
      <p>
        Upload your Aadhaar, PAN, Passport, or other ID documents to extract
        information
      </p>

      <div className="form-group">
        <label>Document Type *</label>
        <select
          value={docType}
          onChange={(e) => setDocType(e.target.value)}
        >
          <option value="">Select document type...</option>
          <option value="Aadhaar">üÜî Aadhaar Card</option>
          <option value="PAN">üí≥ PAN Card</option>
          <option value="Passport">üõÇ Passport</option>
          <option value="Driving License">üöó Driving License</option>
          <option value="Voter ID">üó≥Ô∏è Voter ID</option>
          <option value="Other">üìã Other ID</option>
        </select>
      </div>

      <div
        className="upload-zone"
        onClick={() => document.getElementById("file").click()}
        onDrop={handleDrop}
        onDragOver={(e) => e.preventDefault()}
        style={{ cursor: "pointer" }}
      >
        <div className="upload-icon">‚¨ÜÔ∏è</div>
        <div
          style={{
            fontSize: "1.1rem",
            fontWeight: "600",
            color: "#374151",
            marginBottom: "0.5rem"
          }}
        >
          Drop files here or click to upload
        </div>
        <small style={{ color: "#9ca3af" }}>
          Supports PDF, JPG, PNG (Max 10MB per file)
        </small>

        <input
          id="file"
          type="file"
          multiple
          accept=".pdf,.jpg,.jpeg,.png"
          onChange={handleFiles}
          style={{ display: "none" }}
        />
      </div>

      {files.length > 0 && (
        <div className="files">
          <h3 style={{ marginBottom: "1rem", color: "#374151" }}>
            üìÇ Uploaded Documents ({files.length})
          </h3>

          {files.map((f, i) => (
            <div key={i} className="file">
              <div className="file-icon">üìÑ</div>

              <div className="file-info">
                <div className="file-name">{f.name}</div>
                <div className="file-type">
                  {docType} ‚Ä¢ {(f.size / 1024).toFixed(1)} KB
                </div>
              </div>

              <span style={{ color: "#10b981", fontSize: "1.5rem" }}>‚úì</span>

              <button
                onClick={() => removeFile(i)}
                style={{
                  background: "transparent",
                  border: "none",
                  color: "#ef4444",
                  cursor: "pointer",
                  fontSize: "1.2rem",
                  padding: "0.5rem"
                }}
              >
                ‚úï
              </button>
            </div>
          ))}
        </div>
      )}

      <div className="buttons">
        <button
          className="btn btn-primary"
          onClick={uploadToBackend}
          disabled={!docType || files.length === 0 || loading}
        >
          {loading ? "Uploading..." : "Continue to Extract ‚Üí"}
        </button>
      </div>
    </div>
  );
}
